Proposed Cycle Race Track:  construct a 2.040 km long tarmacadam Cycle Race track (4.5m wide) located on a site in the southern part of Corkagh Park (beside the Green Isle Link Road and the Camac Valley Caravan Park). The track also includes a 743 m Junior Circuit for younger cyclists. The main elements of the scheme are as follows;
the cycle track in the park provides an off-road and safe racing experience for young cyclists - cycle racing on public roads is currently seen by cycle clubs as an obstacle to the development of the sport because of the safety issues for children, due to greater traffic volumes and the competition for road space; 
the site of the track will be enclosed with a 1.2 m high timber post and rail fence with a hedge and will have a gated access to prevent unauthorised access; 
the proposed site for the track currently has excellent road access and nearby car-parking, which will allow it to operate as a National facility and become an important Tourist and Sports amenity within South Dublin; 
the track can be used as a National Road Race cycle training facility; 
the track would provide an additional facility and is hoped will attract many visitors to that part of the park, particularly tourists at the adjacent Caravan Park;  in addition to cycle racing, the track can be used for leisure cycling and as an additional walking route. 
The site surrounding the proposed track currently consists of managed grasslands which will help to screen any hard surfacing when viewed from other parts of the park. It is envisaged that when completed the facility could also be used as a Traffic School for teaching young children with particular emphasis on safety and best practice.  Plans and particulars of the proposed development will be available for inspection or purchase at a fee not exceeding the reasonable cost of making a copy at:
